(8564, 6322, 0, 1, 'TIME&MONEY', '', '0000-00-00 00:00:00', 0000, 0, 2, 10, 'MAKE SOME TIME AND MAKE SOME MONEY!!\r\n\r\nI''M NOT YOUNG BUT I DON''T HAVE MONEY!', '', 181, '', '', '', '', '', '', 0, 1, 0, '2008-10-18 16:58:19', '2015-03-12 13:34:40', '0000-00-00 00:00:00'),
(8565, 6322, 0, 1, 'MODERN ZOMBIE', '', '0000-00-00 00:00:00', 0000, 0, 2, 10, '一天要花幾個小時坐在電腦前面\r\n這問題很重要嗎?\r\n購物網廣告都說讓你不用出門\r\n真是誠實的廣告\r\n交友指數的紀錄今天又破新高\r\n都怪我太有魅力\r\n"要不要ㄧ起出去走走?"你有沒有搞錯\r\n太陽對皮膚不好\r\n\r\nMODERN! ZOMBIE! FUCK YOU!\r\n\r\n你說買誰的CD?喔真是浪費錢\r\n不會用下載就好\r\n現在的錄音軟體方便到了極點\r\n連樂器都不用會\r\n\r\nMODERN! ZOMBIE! FUCK YOU!\r\n', '', 274, '', '', '', '', '', '', 0, 1, 0, '2008-10-18 17:07:47', '2015-03-12 13:34:40', '0000-00-00 00:00:00'),
(8566, 6322, 0, 2, '不對勁', '', '0000-00-00 00:00:00', 0000, 0, 2, 10, 'JULIA一個人站在街角\r\n28對牽手17個吻\r\n她等了一小時21分\r\n男人的手錶漸漸不準\r\n開會加班等待傳真\r\n塞車聽起來也很單純\r\n只是越來越常發生\r\n乖乖認命的等等等\r\n\r\nJULIA一個人躺在床上\r\n語音信箱在笑她笨\r\n枕頭上多了香味一種\r\n保險套卻少了一個\r\n細長髮絲黏在手指\r\n不是自己的黑色頭髮\r\n翻了個身再打一遍\r\n電話依舊.......\r\n\r\nLINDA  PETTY  MARILYN\r\n前女友也太常出現\r\n看著左手愛的TATTOO\r\n不讓自己想的太多\r\n天花板上黑白畫面\r\n泡泡糖彩色的從前\r\n白雪公主影響太深\r\nBLACK CHANNEL RIGHT HERE! RIGHT HERE!\r\n\r\n總覺得 哪裡怪 有沒有 不對勁\r\n總覺得 哪裡怪 有沒有 不對勁\r\n', '', 170, '', '', '', '', '', '', 0, 0, 1, '2008-10-18 17:15:22', '2013-10-07 17:13:07', '0000-00-00 00:00:00'),
(8567, 6322, 0, 3, '加油蒙娜麗', '', '0000-00-00 00:00:00', 0000, 0, 2, 10, '拖著被乞求的頑強身體\r\n要是有錢的話會更好\r\n就算年齡一天天增長\r\n也會重覆相同的錯誤\r\n因為麻煩而不斷發胖\r\n還有不能實現的願望\r\n仔細想想我好像\r\n從來沒有遇過什麼好事\r\n\r\n繼續待在這裡好嗎\r\n那就繼續待在這裡吧\r\n握在手中的武器\r\nㄧ台破爛的RADIO\r\n時代讓人無法喘息\r\n有句話要告訴妳\r\n有起有落才是人生\r\n堅強活在這裡\r\n\r\nHEY! COME ON 蒙娜麗\r\nHEY! COME ON 蒙娜麗\r\n', '', 231, '', '', '', '', '', '', 0, 0, 1, '2008-10-18 17:19:20', '2013-10-07 17:13:07', '0000-00-00 00:00:00'),
