(8608, 160, 848, 1, '逃到墾丁去', '', '2008-07-27 00:00:00', 0000, 15, 0, 7, '逃到墾丁去\r\n\r\n\r\n如果你有一支槍 你會先殺誰呢\r\n我想是會先殺我吧\r\n如果你有一朵雲 你會選在哪裡下雨呢\r\n我想是會下在我頭上吧\r\n\r\n很抱歉又是一次 變成傷害你的人\r\n這一次你終於討厭我了吧\r\n你療傷的老地方 藍天白雲和陽光\r\n會否原諒我像以前的你一樣\r\n\r\n現在我就要出發 逃往墾丁的路上\r\n連經過車城的SEVEN都不停下來\r\n現在我就要出發 連經過四重溪溫泉都不停\r\n就逃到墾丁去', '', 156, '', '陳力寶', '陳力寶', '橘娃娃', '', '', 1, 1, 0, '2008-10-21 11:25:09', '2015-03-12 13:34:42', '0000-00-00 00:00:00'),
