(8634, 6525, 1018, 1, 'I Should Have Known', '', '2008-10-08 00:00:00', 0000, 20, 0, 4, 'There''s something inside my heart\r\nCan’t put a finger on it\r\nBizarre longing, thoughts of you\r\nThis is my love , I\r\nPut it gently in your hands\r\n\r\nAnd I thought that you would treat it as well as you can\r\nBut that song resounds my head,\r\nright now, right here\r\nIt sings\r\nIt''s me that broken in your hand\r\nIt''s me that broken in your hand!\r\nIt''s me that broken in your hand!!\r\nIt''s me that broken in your hand!!!\r\n\r\nI should have known\r\nIt was a stupid move to take it, to love again, to crave it\r\nI should have known\r\nYour words’ so beautiful, I’m too weak to deny\r\nI believed in you\r\nWhy do I always fall again', '', 247, '', 'Fran', 'Fran', '劉慕堯', 'avex愛迴股份有限公司', '', 1, 1, 0, '2008-10-21 18:01:10', '2015-03-12 13:34:43', '0000-00-00 00:00:00'),
(8635, 6525, 1018, 2, '我不等', '', '2008-10-08 00:00:00', 0000, 20, 0, 4, '說不清等什麼\r\n我害怕這孤單\r\n只是不肯承認\r\n也不想表現失敗\r\n\r\n我 要自己的未來\r\n我自己安排\r\n暫時把時間填滿\r\n為那一刻  彩排\r\n\r\n我不等 曇 花\r\n也不等 美 滿\r\n不希罕 平安\r\n不等一輩子的等待\r\n\r\n我不等 造化\r\n也不等 陪伴\r\n我不等什麼嬋娟\r\n不等祢不給的 萬語千   言\r\n\r\nSomehow I feel so long\r\n有誰明白我能  等 什麼 (其實我不知道 等 什麼)\r\n但  也許人生就這麼差不多\r\n我也別 太緊張\r\n最後該我的 會該我\r\n\r\n''cause I would do\r\nEverything', '', 249, '', 'Fran', 'Fran', '劉慕堯', 'avex愛迴股份有限公司', '', 1, 1, 0, '2008-10-21 18:01:52', '2015-03-12 13:34:43', '0000-00-00 00:00:00'),
(8636, 6525, 1018, 3, 'May I Kiss You Goodnight', '', '2008-10-08 00:00:00', 0000, 20, 0, 4, '吻你味道  \r\n教我受不了\r\n怎麼能夠 那麼美好\r\n金色的太陽\r\n它也微笑\r\n你的肌膚 透著亮, 哎\r\n\r\n你嗓音\r\n在耳梢纏繞\r\n想著想著\r\n就發了燒\r\n溫度太好\r\n好想要把你給吃掉\r\n\r\nMay I kiss you goodnight\r\nMay I kiss you every night\r\nMay I kiss you goodnight\r\nMay I kiss you every night\r\n\r\n你嗓音\r\n在耳梢纏繞\r\n想著想著\r\n就發了燒\r\n你太美好\r\n跟著我回家 好不好', '', 190, '', 'Fran', 'Fran', '劉慕堯', 'avex愛迴股份有限公司', '', 1, 1, 0, '2008-10-21 18:02:24', '2015-03-12 13:34:43', '0000-00-00 00:00:00'),
(8637, 6525, 1018, 5, '打雷了', '', '2008-11-07 00:00:00', 0000, 20, 0, 4, '打雷了  \r\n雨 卻停了\r\n我唱著歌\r\n想著 好難得\r\n\r\n他 哭了\r\n我不捨得\r\n既有今日\r\n何必當初呢\r\n\r\n一瞬眼\r\n他是我的\r\n一瞬眼\r\n又消失了\r\n我無法讓自己\r\n執迷不悟作這癡人\r\n\r\n忽然間\r\n都想通了\r\n忽然間\r\n沒關係的\r\n讓雨把我淋著\r\n這渾渾噩噩   \r\n我也笑了 (也是人生)\r\n\r\n打雷了 我笑了 \r\n唱著歌 他哭了\r\n打雷了 他笑了 \r\n誰唱著 誰 哭了', '', 234, '', 'Fran', 'Fran', '劉慕堯', 'avex愛迴股份有限公司', '', 1, 1, 0, '2008-10-21 18:03:02', '2015-03-12 13:34:43', '0000-00-00 00:00:00'),
(8638, 6525, 1018, 5, '森林', '', '2008-10-08 00:00:00', 0000, 20, 0, 4, '這個森林 沒有出口\r\n我已經 走進迷宮\r\n你的道理 我無法反駁\r\n詞窮了 我\r\n\r\n為我好到 教我感動\r\n替我著想 你真敢說\r\n你總是對 我總是錯\r\n怎麼也不怎麼\r\n\r\n我不想 歇斯底里\r\n你害的我 心臟好痛\r\n什麼都任你要求\r\n現在 還要自由\r\n\r\n你給了什麼啊\r\n你還想說什麼\r\n你給了什麼\r\n現在要我說什麼\r\n\r\n我什麼都沒有\r\n早已經被掏空\r\n我 一無所有\r\n你還要 向我討什麼\r\n\r\n這個森林 沒有出口', '', 189, '', '', '', '', '', '', 1, 1, 0, '2008-10-21 18:03:34', '2015-03-12 13:34:43', '0000-00-00 00:00:00'),
