(8722, 6200, 0, 1, '上下左右AB', '打電動打了半天還是卡關嗎?試試看密技的威力!\r\n', '0000-00-00 00:00:00', 0000, 5, 0, 9, '邪惡勢力攻進村莊之前\r\n武器店裡尋找著新裝備\r\n忽左忽右沒有方向的路人\r\n只會說著一句話\r\n\r\n魔王總是那麼強\r\n等級或許還太嫩\r\n打小怪提升經驗\r\n快來幫我補個血\r\n\r\n快輸入密技 上下左右AB\r\n隱藏人物出來吧 上下左右AB\r\n快輸入密技 上下左右AB\r\n隱藏道具出來吧 上下左右AB\r\n\r\n為何史萊姆總是那麼不幸\r\n總是被當作最低級的怪物\r\n當然也會不小心被ko\r\n最痛恨忘了紀錄\r\n\r\n看著我的攻略本\r\n離開惱人的迷宮\r\n打小怪賺取金錢\r\n沒血快回去睡覺\r\n', '', 259, '', '張竣傑', '張竣傑', '複製貼上', '', '', 0, 0, 1, '2008-10-24 23:30:05', '2013-10-07 17:13:09', '0000-00-00 00:00:00'),
(8723, 6200, 0, 2, '成長', '高中三年級的時候做的~要獻給畢業生. 描述高三生活即將要面對的種種事物~高三將會是一個轉捩點~勇敢面對~就會成長!\r\n\r\n', '0000-00-00 00:00:00', 0000, 0, 1, 10, '一個人最大的悲哀-不是被當而是沒有實現夢想-\r\n高中經過許多挫敗-目的就是成長\r\n\r\n靜靜坐著望那窗戶外的天- Taipei one O one迷幻的光點-\r\n黑板文字消失在我眼前-淚淹沒我視線\r\n輕輕想著你那天真無邪-水蜜桃般甜甜的感覺-\r\n我並沒有失去了一切-絕望在幻滅!\r\n\r\n國文學到表白的新招-你眼睛會笑彎成一座橋-\r\n但終點卻是我永遠都到達不了-\r\n\r\n你若害怕我會保護你-如果孤獨我會陪伴你-\r\n請不要放棄-我們重新再努力-\r\n\r\nAfter青少年的時代-越來越少人會為你著想-\r\n我們應該把握現在-為自己想一想-\r\n\r\n望著旁邊同學那可愛的臉-握緊他的手淚水泛著眼-\r\n前面景物再次看不見-試著把淚拭乾-\r\n突然一聲老師叫我起來-害我一時不知該怎麼辦-\r\n面對多次被叫的經驗-我應該很慘-\r\n\r\n英文也有學到新招式-Make hay while the sun shines\r\nLiving without an aim is like sailing without a compass\r\n\r\n你若害怕我會保護你-如果孤獨我會陪伴你-請不要放棄-我們重新再努-\r\n你應該要相信自己-就像會在黑暗中生計-別太多壓力-我們會在一起-\r\n\r\n做事別太執著-知道感覺知道過生活-\r\n\r\n你若害怕我會保護你-如果孤獨我會陪伴你-請不要放棄-我們重新再努-\r\n你應該要相信自己-就像會在黑暗中生計-別太多壓力-阿~~~~~~\r\n你若害怕我會保護你-如果孤獨我會陪伴你-請不要放棄-我們重新再努-\r\n你應該要相信自己-就像會在黑暗中生計-別太多壓力-我們永遠在一起-', '', 237, '', '林穎新', '林穎新', '複製貼上', '', '', 0, 0, 1, '2008-10-24 23:30:51', '2013-10-07 17:13:09', '0000-00-00 00:00:00'),
(8724, 6696, 0, 1, '獲得你的心 EP', '初次販賣~請多指教!!', '0000-00-00 00:00:00', 0000, 0, 1, 4, '獲得你的心\r\n詞.曲.編曲:徐詠福  \r\n\r\n做了什麼　我才懂得\r\n愛情就這樣錯過了\r\n我依依不捨　又一臉錯愕\r\n\r\n你的世界　能讓我感覺\r\n對我那真正的體貼\r\n就一句感謝　都不覺得可憐\r\n\r\n想過一些　你的笑臉\r\n早已經全都不見\r\n\r\n我沒有什麼可以獲得你的心\r\n無法想起的過去\r\n就讓他隨著風過境\r\n\r\n我沒有什麼可以獲得你的心\r\n就算是我放棄\r\n我一直等待你的心回來', '', 226, '', '詠詠', '詠詠', '詠詠', '', '', 0, 0, 1, '2008-10-25 14:40:19', '2013-10-07 17:13:09', '0000-00-00 00:00:00'),
(8725, 6696, 1026, 1, '01.獲得你的心', '曲風：抒情搖滾，帶點悲傷感。', '2008-10-25 00:00:00', 0000, 10, 0, 4, '1.獲得你的心\r\n\r\n做了什麼　我才懂得\r\n愛情就這樣錯過了\r\n我依依不捨　又一臉錯愕\r\n\r\n你的世界　能讓我感覺\r\n對我那真正的體貼\r\n就一句感謝　都不覺得可憐\r\n\r\n想過一些　你的笑臉\r\n早已經全都不見\r\n\r\n我沒有什麼可以獲得你的心\r\n無法想起的過去\r\n就讓他隨著風過境\r\n\r\n我沒有什麼可以獲得你的心\r\n就算是我放棄\r\n我一直等待你的心回來\r\n                        ', '', 226, '', '詠詠', '詠詠', '詠詠', '', '', 0, 1, 0, '2008-10-25 15:12:41', '2015-03-12 13:34:46', '0000-00-00 00:00:00');
